import React from "react";
import { Form, Formik } from 'formik';
import MyTextField from '.'
import "./account.scss";

export default function Signin() {
    return (
        <div className='signin'>
            <div className="container">
                <div className="mainTitle">
                    Sign in
                </div>
                <Formik
                    initialValues={{
                        firstName: '',
                        lastName: '',
                    }}
                    onSubmit={(values, actions) => {
                        setTimeout(() => {
                            alert(JSON.stringify(values, null, 2));
                            actions.setSubmitting(false);
                        }, 1000);
                    }}
                >
                    {(props) => (
                        <Form>
                            {/* <MyTextField name="firstName" type="text" label="Username" />
                            <MyTextField name="lastName" type="text" label="Last Name" /> */}
                            <button type="submit">Next</button>
                        </Form>
                    )}
                </Formik>
            </div>

            <div className="centerText commonLabels">
                New to Autodesk ? <a href={''} >Create account</a>
            </div>

            <div className="footer commonLabels">
                <p>Your account for everything Autodesk</p>
                <a href={''} >Learn More</a>
            </div>
        </div>
    );
}
